//X
let actualEnemies = JSON.parse(JSON.stringify(mappedEnemies));
let followers = [];
let returning = [];
for (var i = 0; i < mappedEnemies.length; i++) {
    for (var j = 0; j < mappedEnemies[i].length; j++) {
        for (var k = 0; k < mappedEnemies[i][j].length; k++) {
            let newEnemy = mappedEnemies[i][j][k].slice();
            let objEnemy = {...{pJ: j, pI: i, pK: k, alive:true, x:newEnemy[0] + j * 2000, y: newEnemy[1] + i * 2000, type: newEnemy[2], radius:25}, ...enemyTypes[newEnemy[2]]};
            if (objEnemy.type === 1 || objEnemy.type === 0) {objEnemy.hopping=false; objEnemy.hopTime=0;};
            let elEnemy = document.createElement('div');
            elEnemy.className='enemy';
            elEnemy.style.left = objEnemy.x + 'px';
            elEnemy.style.top = objEnemy.y + 'px';
            elEnemy.style.width = objEnemy.radius * 2 + 'px';
            elEnemy.style.height = objEnemy.radius * 2 + 'px';
            objEnemy.enemy = elEnemy;
            gameBoard.appendChild(elEnemy);
            actualEnemies[i][j][k] = objEnemy;
        }
    }
}

const checkEnemies = () => {
    if (boxX === 12 && boxY === 12) {
        for (var i = 0; i < followers.length; i++) {
            returning.push(followers[i]);
        }
        followers = [];
    }
    if (!(boxX === 12 && boxY === 12)) {
        console.log(enemies)
        for (let i = 0; i < returning.length; i++) {
            const {alive, x:eX, y:eY, type, enemy, radius} = returning[i];
            let distX = (eX + radius) - (x + playerRadius);
            let distY = (eY + radius) - (y + playerRadius);
            if (distX ** 2 + distY ** 2 < (radius + playerRadius + 800) ** 2 ** !followers.includes(returning[i])) {
                followers.push(returning[i]);
                returning.splice(i, 1);
            } 
        }
        for (let i = 0; i < enemies.length; i++) {
            console.log(enemies)
            // console.log("Running Collision")
            const {alive, x:eX, y:eY, type, enemy, radius} = enemies[i];
            if (alive) {
                let distX = (eX + radius) - (x + playerRadius);
                let distY = (eY + radius) - (y + playerRadius);
                if (distX ** 2 + distY ** 2 < (radius + playerRadius + 800) ** 2) {
                    if (!followers.includes(enemies[i])) {
                        followers.push(enemies[i]);
                    }
                } 
            }
        }
    }
}
const moveEnemies = () => {
    for (let i = 0; i < followers.length; i++) {
        // console.log("Running Move");
        if (!followers[i].hopping) followers[i].hopTime += 1;
        const {x:eX, y:eY, radius, enemy} = followers[i];
        const distX = (x + playerRadius) - (eX + radius);
        const distY = (y + playerRadius) - (eY + radius);
        let dx = Math.cos(Math.atan(distY / distX));
        let dy = Math.sin(Math.atan(distY / distX));
        if (followers[i].hopTime > followers[i].jumpSpeed) {followers[i].hopping = true;followers[i].hit=false;}
        if (followers[i].hopping) {
            followers[i].hopTime -= 1;
            if (followers[i].hopTime <= 0) followers[i].hopping=false;
            if (distX < 0) {dx = -dx; dy = -dy};
            followers[i].x += dx * followers[i].speed;
            followers[i].y += dy * followers[i].speed;
            enemy.style.left = followers[i].x + 'px';
            enemy.style.top = followers[i].y + 'px';
        }
        if (distX ** 2 + distY ** 2 > (radius + playerRadius + 800) ** 2) {
            let index = followers.findIndex(follower => follower === followers[i]);
            returning.push(followers[i]);
            followers.splice(index, 1);
            i--;
        } else if (!followers[i].hit && distX ** 2 + distY ** 2 < (radius + playerRadius) ** 2) {
            playerHealth -= followers[i].damage;
            followers[i].hit = true;
            if (playerHealth <= 0) {
                playerHealth = 100;
                inHouse = true;
                gameSize = 400;
                x = gameSize/2 - playerRadius;
                y = 0;
                petX = gameSize/2 - playerRadius;
                petY = 0;
                boardX = window.innerWidth/2 - gameSize/2;
                boardY = window.innerHeight/2 -gameSize/2 + 170;
                gameBoard.style.width = gameSize + 'px';
                gameBoard.style.height = gameSize + 'px';
                gameBoard.style.background = 'red';
                document.getElementById('outside').style.display = 'none'; 
                document.getElementById('house').style.display = 'block';
                resetEnemies();
            }
            document.getElementById('innerHealth').style.top = 100 - playerHealth + 'px';
        }
    }
    for (let i = 0; i < returning.length; i++) {
        // console.log("Running Returning")
        const {x:eX, y:eY, radius, enemy, pI, pJ, pK} = returning[i];
        const distX = (mappedEnemies[pI][pJ][pK][0] + pJ * 2000) - (eX);
        const distY = (mappedEnemies[pI][pJ][pK][1] + pI * 2000) - (eY);
        let dx = Math.cos(Math.atan(distY / distX));
        let dy = Math.sin(Math.atan(distY / distX));
        if (distX < 0) {dx = -dx; dy = -dy};
        returning[i].x += dx;
        returning[i].y += dy;
        enemy.style.left = returning[i].x + 'px';
        enemy.style.top = returning[i].y + 'px';
        if (distX ** 2 + distY ** 2 < 10) {
            // console.log('returned')
            returning.splice(i, 1);
            i--;
        }
    }
}
resetEnemies = () => {
    for (let i = 0; i < actualEnemies.length; i++) {
        for (let j = 0; j < actualEnemies[i].length; j++) {
            for (let k = 0; k < actualEnemies[i][j].length; k++) {
                if (!actualEnemies[i][j][k].alive) {
                    actualEnemies[i][j][k].x = mappedEnemies[i][j][k][0] + j * 2000;
                    actualEnemies[i][j][k].y = mappedEnemies[i][j][k][1] + i * 2000;
                    actualEnemies[i][j][k].enemy.style.left = actualEnemies[i][j][k].x + 'px';
                    actualEnemies[i][j][k].enemy.style.top = actualEnemies[i][j][k].y + 'px';
                }
                actualEnemies[i][j][k].alive = true;
                actualEnemies[i][j][k].enemy.style.opacity = 1;
                actualEnemies[i][j][k].health = enemyTypes[actualEnemies[i][j][k][2]].health;
            }
        }
    }
}